script: |
  super -f text -I q949.spq | sort > q949.out

inputs:
  - name: q949.spq
    data: |
      SELECT DISTINCT + col1 * col0 AS col0 FROM tab1 (FORMAT parquet) WHERE col2 / + col2 NOT BETWEEN ( + col1 ) AND NULL;
  - name: tab1

outputs:
  - name: q949.out
    data: |
      425
      4277
      714
